import React, { Component, Fragment } from 'react';
import { Link } from 'react-router-dom';
import '../App.css';
import logo from '../img/Logo final.svg'
import gql from "graphql-tag";
import { Query, Mutation } from "react-apollo";
class EditScreen extends Component {
    constructor() {
        super();
        console.log(this.props.match.params.logo);
    }

    render() {
        return (
            <Fragment>
                <header>
                    <div className="logo-container">
                        <img className="logo" src={logo} alt="Logo" />
                    </div>
                    <nav>
                        <ul className="nav-links">
                            <li className="nav-link">Signed in as User101@gmail.com</li>
                            <li className="nav-link"><div className="yellow">SETTINGS</div></li>
                            <li className="nav-link"><div className="red">LOG OUT</div></li>
                        </ul>
                    </nav>
                </header>
                <section>
                    <div className="control-container">
                        <div id="canvas_controls">
                        </div>
                        <div id="text_controls">

                        </div>
                        <div id="image_controls">

                        </div>
                        <div id="button_controls">

                        </div>
                    </div>
                    <div style={{ backgroundColor: "black" }} className="workplace-container">
                    </div>
                </section>
                <footer>
                    <div className="footer_text">
                        Powered by GologoLo.org
                                </div>
                </footer>
            </Fragment>
        );
    }
}

export default EditScreen;
